import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import "../styles/searchFlights.css";

const SearchFlightsPage = () => {
  const location = useLocation();
  const { searchParams } = location.state;
  const [flights, setFlights] = useState([]);

  useEffect(() => {
    const fetchFlights = async () => {
      try {
        const response = await fetch(
          `http://localhost:4000/api/flights/search-flights?from=${searchParams.from}&to=${searchParams.to}&startDate=${searchParams.startDate}&endDate=${searchParams.endDate}`
        );

        const data = await response.json();

        if (response.ok) {
          setFlights(data);
        } else {
          console.error(
            data.message || "An error occurred while searching flights."
          );
        }
      } catch (error) {
        console.error("An error occurred while searching flights.", error);
      }
    };

    fetchFlights();
  }, [searchParams]);

  return (
    <div className="container mx-auto px-4 py-10">
      <h2 className="text-2xl font-bold mb-6">Search Results</h2>
      <div className="filters mb-4">
        <select className="mr-2">
          <option value="direct">Direct</option>
          <option value="connecting">Connecting</option>
        </select>
        <select>
          <option value="airline1">Airline 1</option>
          <option value="airline2">Airline 2</option>
        </select>
      </div>
      {flights.map((flight) => (
        <div
          key={flight._id}
          className="bg-white rounded-lg shadow-md mb-6 p-6 flex flex-col md:flex-row justify-between items-center"
        >
          <div className="flex flex-col md:flex-row items-center mb-4 md:mb-0">
            <div className="flex flex-col items-center md:items-start">
              <span className="text-xl font-bold">
                {new Date(flight.flightDate).toLocaleTimeString([], {
                  hour: "2-digit",
                  minute: "2-digit",
                })}
              </span>
              <span className="text-sm text-gray-600">{flight.from}</span>
              <span className="text-sm text-gray-600">ADB</span>
            </div>
            <div className="flex flex-col items-center md:items-center mx-4">
              <span className="text-sm text-gray-600">Direct</span>
            </div>
            <div className="flex flex-col items-center md:items-end">
              <span className="text-xl font-bold">
                {new Date(flight.flightDate).toLocaleTimeString([], {
                  hour: "2-digit",
                  minute: "2-digit",
                })}
              </span>
              <span className="text-sm text-gray-600">{flight.to}</span>
              <span className="text-sm text-gray-600">IST</span>
            </div>
          </div>
          <div className="flex flex-col items-center md:items-end mb-4 md:mb-0">
            <span className="text-sm text-gray-600">
              Flight duration {flight.flightDuration}
            </span>
            <span className="text-sm text-gray-600">
              Operated by: {flight.operatedBy}
            </span>
          </div>
          <div className="flex flex-col md:flex-row items-center md:items-center mb-4 md:mb-0">
            <div className="flex flex-col items-center md:items-start mx-4">
              <span className="text-lg font-bold">Economy</span>
              <span className="text-sm">Per passenger</span>
              <span className="text-xl font-bold">
                TRY {flight.economyPrice}
              </span>
            </div>
            <div className="flex flex-col items-center md:items-end mx-4">
              <span className="text-lg font-bold">Business</span>
              <span className="text-sm">Per passenger</span>
              <span className="text-xl font-bold">
                TRY {flight.businessPrice}
              </span>
              <span className="text-sm text-red-500">4 left at this price</span>
            </div>
          </div>
          <div className="itinerary-details">
            <span className="text-blue-500 cursor-pointer">
              Itinerary details
            </span>
          </div>
        </div>
      ))}
    </div>
  );
};

export default SearchFlightsPage;
